export class CapabilityError extends Error {
    name;
    capabilityId;
    method;
    callbackId;
    constructor(message, options) {
        super(message);
        this.name = 'CapabilityError';
        if (options) {
            this.capabilityId = options.capabilityId;
            this.method = options.method;
            this.callbackId = options.callbackId;
        }
    }
}
